import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';

const StockDetailPage = () => {
  const { id } = useParams(); // Get the id from the URL
  const [stockDetails, setStockDetails] = useState(null);

  useEffect(() => {
    axios
      .get(`http://127.0.0.1:8000/${id}`)
      .then((response) => {
        setStockDetails(response.data);
      })
      .catch((err) => {
        alert(err);
      });
  }, [id]);

  return (
    <div className="App">
      <h2 className='App-header'>Stock Details for ID: {id}</h2>
      {stockDetails ? (
        <div className='details'>
          <p>Date: {stockDetails.date}</p>
          <p>Trade Code: {stockDetails.trade_code}</p>
          <p>High: {stockDetails.high}</p>
          <p>Low: {stockDetails.low}</p>
          <p>Open: {stockDetails.open}</p>
          <p>Close: {stockDetails.close}</p>
          <p>Volume: {stockDetails.volume}</p>
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
};

export default StockDetailPage;
